Purpose This reward encourages the aircraft to minimize its distance to the target. The closer it gets to the goal, the higher the reward. How It Works Calculate Distance : The function calculates the Euclidean distance from the aircraft’s previous position to the goal (previous_distance) and from its current position to the goal (current_distance). previous_distance = euclidean_distance( [previous_latitude, previous_longitude], goal_coordinates
)
current_distance = euclidean_distance( [aircraft.latitude, aircraft.longitude], goal_coordinates
) Compute Reward : The difference between the previous and current distances determines progress: distance_progress_reward = scaling_factors.get("distance") * ( previous_distance - current_distance
) If the aircraft moves closer to the goal, the reward is positive. Moving away results in a negative reward. Scaling Factor : A scaling factor (scaling_factors.get("distance")) adjusts the reward’s magnitude to influence the agent's learning. Why It’s Important Encourages Goal-Oriented Behavior : Guides the agent to prioritize moving toward the target. Reward Alignment : Reflects progress in terms of simulation objectives.
